import os
import random
import timeit
import types

import torch

from vllm.sequence import Sequence, SequenceStatus, HiddenStates


def build_seq(prompt_len=200, out_len=100, block_size=16):
    inputs = {
        "prompt_token_ids": list(range(prompt_len)),
        "prompt": "p" * prompt_len,
    }
    seq = Sequence(seq_id=1, inputs=inputs, block_size=block_size)
    for _ in range(out_len):
        seq.data.append_token_id(random.randint(0, 1000), 0.0)
    return seq


def bench_get_last_token_id(seq, n=200_000):
    return timeit.timeit(lambda: seq.get_last_token_id(), number=n)


def bench_n_blocks(seq, n=200_000):
    return timeit.timeit(lambda: seq.n_blocks, number=n)


class DummySG:
    def __init__(self, ids):
        self.seq_data = ids


def build_hidden_states(n=4000, d=32):
    # Bypass HiddenStates.__init__ checks by manual construction
    hs = HiddenStates.__new__(HiddenStates)
    hs.seq_ids = list(range(n))
    hs.hidden_states = torch.randn(n, d)
    return hs


def bench_prune(hs_builder, n_runs=50, n=4000):
    # Each run constructs a fresh object to ensure identical work each time
    def run_once():
        hs = hs_builder()
        new_ids = [i for i in range(n) if (i % 7) != 0]  # remove ~14%
        sg_list = [DummySG(new_ids)]
        hs.prune(sg_list)

    return timeit.timeit(run_once, number=n_runs)


def bench_get_finished_reason(n=500_000):
    statuses = [
        SequenceStatus.FINISHED_STOPPED,
        SequenceStatus.FINISHED_LENGTH_CAPPED,
        SequenceStatus.FINISHED_ABORTED,
        SequenceStatus.FINISHED_IGNORED,
        SequenceStatus.RUNNING,
    ]
    i = 0

    def run_once():
        nonlocal i
        i = (i + 1) % len(statuses)
        SequenceStatus.get_finished_reason(statuses[i])

    return timeit.timeit(run_once, number=n)


if __name__ == "__main__":
    random.seed(0)

    seq = build_seq()
    t_last = bench_get_last_token_id(seq)
    t_blocks = bench_n_blocks(seq)

    hs_builder = lambda: build_hidden_states(4000, 32)
    t_prune = bench_prune(hs_builder)

    t_reason = bench_get_finished_reason()

    print({
        "get_last_token_id": t_last,
        "n_blocks": t_blocks,
        "hidden_states.prune": t_prune,
        "get_finished_reason": t_reason,
    })

